import React, { Component } from "react";
import "../css/Logo.css";

class Logo extends Component {

  componentDidUpdate() {
    setTimeout(this.props.toggleLogoSpeed, 3000);
  }
  render() {
    const { alt, src, spinSpeed } = this.props;
    return (
      <div className={`logo-container ${spinSpeed}`}>
        <img className="logo" alt={alt} src={src} />
      </div>
    )
  }
}

export default Logo;
